import React from "react";
import GiphyIronMan from "./components/GiphyIronMan";
import "./App.css"

const IronManPage = () => {
    return (
    <div>
        <div>
            <h1 className="ironman">IRON MAN GIPHY</h1>   
        </div>
        <GiphyIronMan />
    </div>
    );
}

export default IronManPage
